-- Dumping structure for procedure avthardwaretrading.get_ap_aging
DROP PROCEDURE IF EXISTS `get_ap_aging`;
DELIMITER //
CREATE PROCEDURE `get_ap_aging`(
	IN `p_supplier_id` INT,
	IN `p_payment_mode_id` INT,
	IN `p_as_of_date` DATE
)
BEGIN
   SELECT 
        s.id AS supplier_id,
        s.supplier_code,
        s.name AS supplier_name,
        p.po_number AS purchase_number,
        p.date AS purchase_date,
        p.grand_total AS purchase_amount,

        -- total paid across all payments
        COALESCE(sub.total_paid, 0) AS total_paid,

        -- outstanding balance = grand total - total paid
        (p.grand_total - COALESCE(sub.total_paid, 0)) AS outstanding_balance,

        -- individual payment details
        pp.amount_paid,
        pp.payment_date,
        pp.payment_status,

        pm.name AS payment_method,
        pm.term AS payment_term,

        CASE
            WHEN DATEDIFF(p_as_of_date, p.date) <= 0 THEN 'Current'
            WHEN DATEDIFF(p_as_of_date, p.date) BETWEEN 1 AND 30 THEN '1-30 Days'
            WHEN DATEDIFF(p_as_of_date, p.date) BETWEEN 31 AND 60 THEN '31-60 Days'
            WHEN DATEDIFF(p_as_of_date, p.date) BETWEEN 61 AND 90 THEN '61-90 Days'
            ELSE '90+ Days'
        END AS aging_bucket
    FROM purchases p
    INNER JOIN suppliers s ON s.id = p.supplier_id
    LEFT JOIN mode_of_payment pm ON pm.id = p.payment_id
    LEFT JOIN purchase_payments pp ON pp.purchase_id = p.id
    LEFT JOIN (
        SELECT purchase_id, SUM(amount_paid) AS total_paid
        FROM purchase_payments
        GROUP BY purchase_id
    ) sub ON sub.purchase_id = p.id
    WHERE 
        (p_supplier_id IS NULL OR p.supplier_id = p_supplier_id)
        AND (p_payment_mode_id IS NULL OR p.payment_id = p_payment_mode_id)
    ORDER BY s.name, p.date, pp.payment_date;
END//
DELIMITER ;

-- Dumping structure for procedure avthardwaretrading.get_ar_aging
DROP PROCEDURE IF EXISTS `get_ar_aging`;
DELIMITER //
CREATE PROCEDURE `get_ar_aging`(
	IN `p_customer_id` INT,
	IN `p_payment_mode_id` INT,
	IN `p_as_of_date` DATE
)
BEGIN
    SELECT 
        c.customer_code,
        c.name AS customer_name,
        i.invoice_number,
        i.invoice_date,
        i.due_date,
        ac.entry_type,
        ac.amount AS adjustment_amount,
        i.outstanding_balance,
        (i.outstanding_balance + 
            CASE 
                WHEN ac.entry_type = 'Debit' THEN ac.amount
                WHEN ac.entry_type = 'Credit' THEN -ac.amount
                ELSE 0
            END
        ) AS adjusted_outstanding_balance,
        i.grand_total AS invoice_amount,
        col.amount_paid,
        col.payment_date AS collection_date,
        pm.name AS payment_method,
        i.payment_status,
        i.invoice_status,

        --  Add aging bucket classification
        CASE
            WHEN DATEDIFF(p_as_of_date, i.due_date) <= 0 THEN 'Current'
            WHEN DATEDIFF(p_as_of_date, i.due_date) BETWEEN 1 AND 30 THEN '1-30 Days'
            WHEN DATEDIFF(p_as_of_date, i.due_date) BETWEEN 31 AND 60 THEN '31-60 Days'
            WHEN DATEDIFF(p_as_of_date, i.due_date) BETWEEN 61 AND 90 THEN '61-90 Days'
            ELSE '90+ Days'
        END AS aging_bucket

    FROM invoices i
    INNER JOIN customers c ON c.id = i.customer_id
    LEFT JOIN adjustment_collections ac ON ac.invoice_no = i.invoice_number
    LEFT JOIN collections col ON col.invoice_id = i.id
    LEFT JOIN mode_of_payment pm ON pm.id = i.payment_mode_id
    WHERE (p_customer_id IS NULL OR c.id = p_customer_id)
    ORDER BY c.name, i.due_date;
END//
DELIMITER ;

