-- Dumping structure for procedure avthardwaretrading.get_inventory_report
DROP PROCEDURE IF EXISTS `get_inventory_report`;
DELIMITER //
CREATE PROCEDURE `get_inventory_report`(
	IN `p_status` VARCHAR(20),
	IN `p_category_id` INT,
	IN `p_supplier_id` INT
)
BEGIN
      SELECT 
        p.id AS product_id,
        p.product_code,
        p.product_name,
        c.name AS category_name,
        u.name AS unit_name,
        s.name AS supplier_name,
        s.address AS supplier_address,
        p.sales_price,
        p.quantity,
        p.threshold,
        p.remaining_stock,
        p.status AS product_status
    FROM products p
    LEFT JOIN categories c ON p.category_id = c.id
    LEFT JOIN product_suppliers ps ON ps.product_id = p.id
    LEFT JOIN suppliers s ON s.id = ps.supplier_id
    LEFT JOIN units u ON u.id = p.unit_id
    WHERE
        -- Status filter
        (
            p_status = 'All'
            OR (p_status = 'In Stock' AND p.quantity > 0)
            OR (p_status = 'Out of Stock' AND p.quantity = 0)
            OR (p_status = 'Low Stock' AND p.quantity <= p.threshold)
        )
        -- Category filter
        AND (p_category_id IS NULL OR p.category_id = p_category_id)
        -- Supplier filter
        AND (p_supplier_id IS NULL OR ps.supplier_id = p_supplier_id)
    ORDER BY p.product_name;
END//
DELIMITER ;

