CREATE PROCEDURE `get_purchase_report`(
	IN `p_product_name` VARCHAR(255),
	IN `p_start_date` DATE,
	IN `p_end_date` DATE
)
BEGIN
    SELECT DISTINCT
        p.po_number,
        p.date AS purchase_date,
        s.name AS supplier_name,
        si.item_description AS product_name,
        pd.qty,
        pd.unit_price,
        pd.total AS total_amount,
        pm.name,
        pm.term
    FROM purchases p
    JOIN purchase_items pd ON p.id = pd.purchase_id
    JOIN purchase_payments pp ON pp.purchase_id = p.id
    JOIN supplier_items si ON si.id = pd.supplier_item_id
    JOIN suppliers s ON p.supplier_id = s.id
    JOIN mode_of_payment pm ON pm.id = p.payment_id
    WHERE (p_product_name IS NULL OR si.item_description = p_product_name)
      AND (p_start_date IS NULL OR p.date >= p_start_date)
      AND (p_end_date IS NULL OR p.date <= p_end_date)
    ORDER BY p.date DESC;
END//
DELIMITER ;

-- Dumping structure for procedure avthardwaretrading.get_sales_report
DROP PROCEDURE IF EXISTS `get_sales_report`;
DELIMITER //
CREATE PROCEDURE `get_sales_report`(
	IN `p_customer_name` VARCHAR(255),
	IN `p_product_name` VARCHAR(255),
	IN `p_salesman` VARCHAR(50),
	IN `p_start_date` DATE,
	IN `p_end_date` DATE
)
BEGIN
    SELECT 
        i.id AS invoice_id,
        i.invoice_number,
        i.invoice_date AS sale_date,
        c.name AS customer_name,
        p.product_name,
        it.qty AS quantity,
        it.price,
        it.amount AS total_amount,
        mp.name AS payment_method,
        i.salesman,
        CASE 
            WHEN i.discount_type = 'overall' THEN 
                CONCAT('Overall Discount: ', 
                       FORMAT(i.discount_value, 2))
            ELSE 
                COALESCE(
                    GROUP_CONCAT(DISTINCT 
                        CONCAT(
                            d.discount_name, 
                            IF(d.discount_value > 0, 
                                CONCAT(' (', d.discount_value, 
                                       IF(d.discount_type = 'percent', '%', ''), ')'), 
                                ''
                            )
                        )
                        SEPARATOR ', '
                    ),
                    '-'
                )
        END AS discount_display
    FROM invoices i
    LEFT JOIN customers c ON c.id = i.customer_id
    LEFT JOIN invoice_sales it ON i.id = it.invoice_id
    LEFT JOIN products p ON it.product_id = p.id
    LEFT JOIN mode_of_payment mp ON mp.id = i.payment_mode_id
    LEFT JOIN invoice_sales_discounts d ON d.invoice_sale_id = it.id
    WHERE (p_customer_name IS NULL OR c.name LIKE CONCAT('%', p_customer_name, '%') COLLATE utf8mb4_unicode_ci)
      AND (p_product_name IS NULL OR p.product_name LIKE CONCAT('%', p_product_name, '%') COLLATE utf8mb4_unicode_ci)
      AND (p_salesman IS NULL OR i.salesman LIKE CONCAT('%', p_salesman, '%') COLLATE utf8mb4_unicode_ci)
      AND (p_start_date IS NULL OR i.invoice_date >= p_start_date)
      AND (p_end_date IS NULL OR i.invoice_date <= p_end_date)
    GROUP BY i.id, it.id
    ORDER BY i.invoice_date DESC;
END//
DELIMITER ;

