-- Dumping structure for procedure avthardwaretrading.sp_generate_estimated_income_report
DROP PROCEDURE IF EXISTS `sp_generate_estimated_income_report`;
DELIMITER //
CREATE PROCEDURE `sp_generate_estimated_income_report`(
	IN `p_filter_type` VARCHAR(20),
	IN `p_start_date` DATE,
	IN `p_end_date` DATE,
	IN `p_customer_id` VARCHAR(255),
	IN `p_product_id` VARCHAR(100)
)
SELECT 
    i.invoice_number,
    DATE_FORMAT(i.invoice_date, '%b %d, %Y') AS invoice_date,
    c.id AS customer_id,
    c.name AS customer_name,
    -- Supplier Info
    s.name AS supplier_name,
    pdt.product_code,
    pdt.product_name,
    ii.qty AS quantity_sold,
    ii.price AS sales_price,
    (ii.price * ii.qty) AS total_sales,

    -- Latest Purchase Info
    pit.po_number AS purchase_number,
    pit.unit_price AS purchase_price,
    pit.qty AS quantity_purchased,
    (pit.unit_price * ii.qty) AS total_purchase_cost,

    -- Estimated Income (per invoice line)
    ((ii.price - COALESCE(pit.unit_price, 0)) * ii.qty) AS estimated_income,


    -- Profit Percentage
    ROUND(
        CASE 
            WHEN ii.price * ii.qty = 0 THEN 0
            ELSE ((ii.price - COALESCE(pit.unit_price,0)) * ii.qty) / (ii.price * ii.qty) * 100
        END, 2
    ) AS profit_percentage

FROM invoices i
INNER JOIN invoice_sales ii ON i.id = ii.invoice_id
INNER JOIN products pdt ON pdt.id = ii.product_id
LEFT JOIN customers c ON c.id = i.customer_id

-- Join to supplier_items using item_code <-> supplier_product_code
LEFT JOIN supplier_items si ON si.item_code = pdt.supplier_product_code
LEFT JOIN suppliers s ON s.id = si.supplier_id

-- Get the latest purchase record per supplier item
LEFT JOIN (
    SELECT 
        pit1.supplier_item_id,
        pit1.unit_price,
        pit1.qty,
        pur1.po_number
    FROM purchase_items pit1
    INNER JOIN purchases pur1 ON pur1.id = pit1.purchase_id
    WHERE (pit1.created_at, pit1.supplier_item_id) IN (
        SELECT MAX(pit2.created_at), pit2.supplier_item_id
        FROM purchase_items pit2
        GROUP BY pit2.supplier_item_id
    )
) AS pit ON pit.supplier_item_id = si.id

WHERE DATE(i.invoice_date) BETWEEN p_start_date AND p_end_date
  AND (p_customer_id IS NULL OR i.customer_id = p_customer_id)
  AND (p_product_id IS NULL OR ii.product_id = p_product_id)
ORDER BY i.invoice_date DESC//
DELIMITER ;

